### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Motif Finding Algorithms**
- **Gibbs Sampling**: A probabilistic technique for motif finding that iteratively samples motifs from sequences.
- **Greedy Motif Search**: An algorithm that builds motifs by iteratively adding the most probable k-mers.
- **Randomized Motif Search**: An algorithm that starts with random motifs and iteratively improves them.

#### 2. **Clustering Algorithms**
- **Soft K-means**: A clustering algorithm where each data point belongs to a cluster with a certain probability.
  - Probability formula:
    \[
    P(C_k \mid x) = \frac{e^{-\beta d_k}}{\sum_{j=1}^{K} e^{-\beta d_j}}
    \]
- **Gaussian Mixture Models (GMM)**: A probabilistic model that assumes all the data points are generated from a mixture of a finite number of Gaussian distributions.
  - Responsibility (posterior probability) formula:
    \[
    \gamma_i = \frac{\pi_k \mathcal{N}(x_i \mid \mu_k, \sigma_k^2)}{\sum_{j=1}^{K} \pi_j \mathcal{N}(x_i \mid \mu_j, \sigma_j^2)}
    \]
  - Gaussian distribution:
    \[
    \mathcal{N}(x \mid \mu, \sigma^2) = \frac{1}{\sqrt{2\pi\sigma^2}} \exp \left( -\frac{(x - \mu)^2}{2\sigma^2} \right)
    \]

#### 3. **Suffix Trees and Tries**
- **Suffix Tree**: A compressed trie of all suffixes of a string.
- **Suffix Trie**: A trie containing all suffixes of a string.
- **Burrows-Wheeler Transform (BWT)**: A technique for data compression and pattern matching.

#### 4. **Phylogenetic Trees and Parsimony**
- **Small Parsimony Algorithm**: An algorithm to find the most parsimonious tree.
- **Additive Distance Matrices**: Matrices that can be represented by a tree with edge weights.

#### 5. **Entropy and Scoring**
- **Entropy**: A measure of the uncertainty or randomness in a set of data.
  - Entropy formula:
    \[
    H = -\sum_{i} p_i \log_2 p_i
    \]
- **Scoring Motifs**: Evaluating the quality of motifs found by an algorithm.

#### 6. **Neighbor-Joining Algorithm**
- **Neighbor-Joining**: An algorithm for constructing phylogenetic trees from distance matrices.
  - \( D^* \) matrix transformation:
    \[
    D^*_{ij} = (K-2)D_{ij} - \sum_{k=1}^{K} D_{ik} - \sum_{k=1}^{K} D_{kj}
    \]

